def ending(mot):
  motmin=mot.lower()
  if motmin in basicwords:
     res=basicwords[motmin].copy()
     return res
  lg=len(mot)-1
  for i in range(lg,1,-1):
    base=mot[-1*i:]
    if  base in onending:
       res=onending[base].copy()
       res["root"]=mot[:-1*i]
       return res
  return None
